function pad(number) {
  if (number < 10) {
    return '0' + number;
  }
  return number;
}

function toISOString(date) {
  return date.getUTCFullYear() +
    '-' + pad(date.getUTCMonth() + 1) +
    '-' + pad(date.getUTCDate()) +
    'T' + pad(date.getUTCHours()) +
    ':' + pad(date.getUTCMinutes()) +
    ':' + pad(date.getUTCSeconds()) +
    'Z';
};

function GETAMAZONPRODUCTINFO(credentials, productID, callback) {
  var secret = credentials.secret;
  var accessKey = credentials.accessKey;
  var associateTag = credentials.associateTag;
  var timestamp = toISOString(new Date)

  var parts = [
   'AWSAccessKeyId=' + accessKey,
   'AssociateTag=' + associateTag,
   'IdType=UPC',
   'ItemId=' + productID,
   'Operation=ItemLookup',
   'ResponseGroup=Large',
   'SearchIndex=All',
   'Service=AWSECommerceService',
   'Timestamp=' + encodeURIComponent(timestamp)
  ];

  var signParts = [
    'GET',
    'webservices.amazon.com',
    '/onca/xml',
    parts.join('&')
  ].join("\n")

  var signature = encodeURIComponent(crypto.enc.Base64.stringify(crypto.HmacSHA256(signParts, secret)));

  var url = 'http://webservices.amazon.com/onca/xml?' + parts.join('&') + '&Signature=' + signature;

  REQUEST(url, function(err, res, body) {
    xml2js.parseString(body, callback);
  });
}
